import React from 'react';
import styles from './Notification.module.css';

export default function Notification() {
    return (
        <div className>
            <span className={styles.header}>KULTTUURI</span> : Nirvanan Lepakko-keikan peruuntumisesta joulukuussa 1991 löytyi uutta tietoa – myös nämä peruutukset ovat ikimuistoisia
        </div>
    )
}
